import React from 'react'
import {
    ComposableMap,
    ZoomableGroup,
    Geographies,
    Geography,
    Markers,
    Marker
} from "react-simple-maps"
import paths from './topo110m.json'
import places from './places.json'


const wrapperStyles = {
    width: "100%",
    margin: "0 auto",
    textDecoration: 'none',
    backgroundColor: '#78D2FA'
}


export default class Globe extends React.Component {
    render() {
        return (
            <div style={wrapperStyles}>
                <ComposableMap
                    projectionConfig={{
                        scale: 180,
                        rotation: [-11, 0, 0],
                    }}
                    style={{
                        width: "100%",
                        height: "auto",
                    }}
                >
                    <ZoomableGroup center={[10, 15]} disablePanning>
                        <Geographies geography={paths}>
                            {(geographies, projection) =>
                                geographies.map((geography, i) =>
                                    geography.id !== "ATA" && (
                                        <Geography key={i} geography={geography} projection={projection} style={
                                            {
                                                default: {
                                                    fill: "#56bd5c",
                                                    stroke: "#39752b",
                                                    strokeWidth: 2,
                                                    outline: "none"
                                                },
                                                hover: {
                                                    fill: "#56bd5c",
                                                    stroke: "#39752b",
                                                    strokeWidth: 2,
                                                    outline: "none"
                                                },
                                                pressed: {
                                                    fill: "#56bd5c",
                                                    stroke: "#39752b",
                                                    strokeWidth: 2,
                                                    outline: "none"
                                                },
                                            }
                                        }/>
                                    ))}
                        </Geographies>
                        <Markers>
                            {places.map((marker, i) => (
                                <Marker
                                    key={i}
                                    marker={marker}
                                    style={
                                        {
                                            default: {
                                                stroke: "#455A64"
                                            },
                                            hover: {
                                                fill: "#56bd5c",
                                                stroke: "#39752b",
                                                strokeWidth: 2,
                                                outline: "none"
                                            }
                                        }
                                    }
                                >
                                    <g>
                                        <rect
                                            strokeWidth="2"
                                            strokeLinecap="square"
                                            strokeMiterlimit="10"
                                            strokeLinejoin="miter"
                                            width="6"
                                            height="3"
                                        />
                                    </g>

                                </Marker>
                            ))}
                        </Markers>
                    </ZoomableGroup>
                </ComposableMap>
            </div>
        )
    }
}
